import s from './GithubActivity.module.scss';
import Card from 'react-github-stats-card/dist/Card';

const GithubActivity = () => {
  const colorTheme = {
    background: 'transparent',
    text: '#ffffff',
    level4: '#8400b8',
    level3: '#b22ff4',
    level2: '#b265f6',
    level1: '#c084f5',
    level0: '#ecd9fc',
  };
  return (
    <div className={s.container}>
       {/* <Card username='vatsalkevadiya' theme={true} /> */}
    </div>
  );
};

export default GithubActivity;
